import { Component } from '@angular/core';
import { IonicPage, NavController, NavParams, ModalController, ViewController, PopoverController, LoadingController, AlertController } from 'ionic-angular';

import { Preview } from '../preview/preview';
import { ColorPopover } from '../colors/colors';
import { CalculatorPage } from '../calculator/calculator';
import { UploadPage } from '../upload/upload';


import { ColorsService } from '../../providers/colors.service';
import { ProjectService } from '../../providers/projects.service';
/**
 * Generated class for the Projects page.
 *
 * See http://ionicframework.com/docs/components/#navigation for more info
 * on Ionic pages and navigation.
 */
@IonicPage()
@Component({
  selector: 'page-projects',
  templateUrl: 'projects.html',
})
export class ProjectsPage {
  
  project: any;
  viewProject: boolean = false;
  showCalc: boolean = false;
  delete: string;

  previewPage: any = Preview;
  projects: Array<any> = [];
  pictures: Array<string> = [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
  ];

  constructor(public navCtrl: NavController, public navParams: NavParams, public colorsSrv: ColorsService, public prjSrv: ProjectService, public modalCtrl: ModalController, public popoverCtrl: PopoverController, public alertCtrl: AlertController, private loadingCtrl: LoadingController) {
     /* for(var i = 0; i< 4; i++){
          this.projects.push({
              name: ["Living Room", "Dining Room", "Guest Room", "Master Bedroom", "Kitchen"][Math.floor(Math.random()*5)],
              pictures: this.getPictureArray(),
              colors: this.getColorArray()
          });
      }
      console.log(this.projects); */
      /*for(var i = 0; i<4; i++){
          this.prjSrv.createProject(["Living Room", "Dining Room", "Guest Room", "Master Bedroom", "Kitchen"][Math.floor(Math.random()*5)], this.getPictureArray()).then((id)=>{
              console.log(id);   
          });
      }*/
      if(navParams.data.id){
          this.viewProject = true;
          this.project = navParams.data;
      }
      this.prjSrv.projectHasChanged.subscribe((status)=>{
          let load = this.loadingCtrl.create({
            content: this.viewProject? 'Updating Project' : 'Updating Projects'
          });
          if(status.create){
              this.prjSrv.getProject(status.id).then(proj=>{
                  this.projects.push(proj);
                  load.dismiss();
              });
          } else if(status.delete) {
              let index = this.projects.findIndex((obj)=>{
                  return obj.id == status.id;
              });
              this.projects.splice(index, 1);
              load.dismiss();
          } else if(status.update) {
              this.prjSrv.getProject(status.id).then(proj=>{
                  let index = this.projects.findIndex((obj)=>{
                      return obj.id == status.id;
                });
                  this.projects[index] = proj;
                  load.dismiss();
              });
          } 
          if(this.viewProject){
              if(this.project.id == status.id && !status.delete){
                  this.prjSrv.getProject(status.id).then(proj =>{
                      this.project = proj;
                      load.dismiss();
                  });
              } else {
                  load.dismiss();
              }
          }
      })
  }

  ionViewDidLoad() {
    console.log('ionViewDidLoad Projects');
      if(!this.viewProject) this.loadProjects();
  }
    ionViewWillEnter(){
        
    }
  loadProjects(){
      let load = this.loadingCtrl.create({
          content: 'Loading Projects'
      });
      load.present().then(()=>{
          this.prjSrv.getProjects().then((projects)=>{
            this.projects = [];
             (projects as any).forEach((el)=>{
                 this.projects.push(el);
             });
               load.dismiss();
          });
      }); 
  }
    
  getColorArray(){
      let colors = [];
      let pad = "000";
      for(var i = 0; i<Math.round(Math.random()*5+1); i++){
          colors.push(this.colorsSrv.getColor((pad+Math.round(Math.random()*300)).slice(-pad.length)));
      }
      return colors;
  }
  getPictureArray(){
      let start = Math.round(Math.random()*(this.pictures.length-1));
      return this.pictures.slice(start);
  }
    
  openCalculator(){
      let modal = this.modalCtrl.create(CalculatorPage, {widget: true}, {'cssClass':'widget'});
      modal.present();
      modal.onDidDismiss((size)=>{
          if(size){
              this.project.size = size;
              this.prjSrv.updateSize(size, this.project);
          }
      });
  }
  toggleCalc(){
      this.showCalc = !this.showCalc;
  }
  toggleDelete(pic){
      if(this.delete == pic){
          this.delete = '';
      } else {
          this.delete = pic;
      }
  }

  openAddProjectModal(){
      let modal = this.modalCtrl.create(CreateProject);
      modal.present();
  }
  openProjectDetail(proj){
      this.navCtrl.push(ProjectsPage, proj);
  }
  openPopover(color){
        let popover = this.popoverCtrl.create(ColorPopover, color, {'cssClass':'color-popover'});
        popover.present();
    }
    
  deleteProject(){
      let alert = this.alertCtrl.create({
          title: 'Delete Project',
          message: 'Are you sure you want to delete '+this.project.name+ '?',
          buttons: [
              {
                  text: 'Cancel',
                  role: 'cancel'
              },
              {
                  text: 'Delete',
                  handler: () => {
                      this.prjSrv.removeProject(this.project).then(()=>{
                          this.navCtrl.pop();
                      })
                  }
              }
          ]
      });
      alert.present();
  }
  deletePic(pic){
      this.delete=''
      let alert = this.alertCtrl.create({
          title: 'Delete Picture',
          message: 'Are you sure you want to delete this photo?',
          buttons: [
              {
                  text: 'Cancel',
                  role: 'cancel'       
              },
              {
                  text: 'Delete',
                  handler: () => {
                      this.prjSrv.removePicture(pic, this.project);
                  }
              }
          ]
      });
      alert.present();
  }
}

@Component({
  selector: 'page-create-project',
  templateUrl: 'create-project.html',
})
export class CreateProject {
    name: string;
    size: any;
    pictures: Array<any> = [];
    color: any;
    
    hasPicture: boolean = false;

  constructor(private viewCtrl: ViewController, public navParams: NavParams, private prjSrv: ProjectService, private loadingCtrl: LoadingController, private modalCtrl: ModalController, private popoverCtrl: PopoverController) {
      if(navParams.data){
          if(navParams.data.type == "color"){
              this.color = navParams.data.color;
          } else if(navParams.data.type == "picture") {
              this.hasPicture = true;
              this.pictures.push(navParams.data.picture);
          }
      }
  }
 dismiss(data?) {
        this.viewCtrl.dismiss(data);
  }
  openCalculator(){
      let modal = this.modalCtrl.create(CalculatorPage, {widget: true}, {'cssClass':'widget'});
      modal.present();
      modal.onDidDismiss((size)=>{
          if(size){
              this.size = size;
          }
      })
  }
  createProject(){
      let load = this.loadingCtrl.create({
          content: "Creating Project"
      });
      
      load.present().then(()=>{
          this.prjSrv.createProject(this.name, this.size, this.pictures, this.color).then((proj)=>{
              load.dismiss();
              this.dismiss(proj);
            });
      });
      
      
  }
    openUpload(){
        let popover=this.popoverCtrl.create(UploadPage,{},{cssClass:'upload-popover'});
        popover.present();
        popover.onDidDismiss((data)=>{
            if(data){
                this.pictures = data;
                this.hasPicture = true;
            }
        });
    }

}

